import React from "react";
import "./Project.css";

const Projects = () => {
  const projects = [
    {
      title: "Bluff City Paving",
      description: "Expert asphalt paving, repair, and maintenance services for various clients.",
      image: `${process.env.PUBLIC_URL}/assets/image1.jpg`,
      link: "https://bluffcityasphalt.com/",
    },
    {
      title: "SERP-P",
      description: "Comprehensive database of Philippine development research for policymaking.",
      image: `${process.env.PUBLIC_URL}/assets/image2.png`,
      link: "https://serp-p.pids.gov.ph",
    },
    {
      title: "Asphalt Services Inc.",
      description: "High-quality asphalt paving, repair, and maintenance projects.",
      image: `${process.env.PUBLIC_URL}/assets/image3.jpg`,
      link: "https://asphaltservicesinc.com/",
    },
    {
      title: "Klik Media Group",
      description: "This is a sample project description...",
      image: `${process.env.PUBLIC_URL}/assets/image4.jpg`,
      link: "home",
    },
    {
      title: "Kode Across",
      description: "Trusted software development company helping businesses of all sizes.",
      image: `${process.env.PUBLIC_URL}/assets/image5.png`,
      link: "https://kodeacross.com/",
    },
    {
      title: "KCP",
      description: "The King’s College of the Philippines.",
      image: `${process.env.PUBLIC_URL}/assets/image6.png`,
      link: "home",
    },
    {
      title: "R & S Paving LLC",
      description: "Specializes in driveway paving, sealcoating, and concrete work.",
      image: `${process.env.PUBLIC_URL}/assets/image6.png`,
      link: "https://www.rspavingllc.com/",
    },
  ];

  return (
    <section id="portfolio" className="portfolio-section">
      <div className="portfolio-header">
        <h2>Portfolio</h2>
        <div className="divider"></div>
      </div>
      <div className="portfolio-grid">
        {projects.map((project, index) => (
          <div className="portfolio-item" key={index}>
            <img src={project.image} alt={project.title} />
            <div className="portfolio-overlay">
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <a href={project.link} target="_blank" rel="noopener noreferrer">
                Live Preview
              </a>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
